import { ethers } from 'ethers';


const abi = [
    "event sent(bytes message, bytes32 committedhash, bytes32 calculatedhash, bytes metadata)"
];


const eventSignature = "sent(bytes,bytes32,bytes32,bytes)";


const iface = new ethers.utils.Interface(abi);


const encodedLog = {
    topics: [
        ethers.utils.id(eventSignature),

    ],
    data: "" 
};

// Decode the event data
const decodedLog = iface.parseLog(encodedLog);

// Access the decoded parameters
const { message, committedhash, calculatedhash, metadata } = decodedLog.args;

console.log('Message:', message);
console.log('CommittedHash:', committedhash);
console.log('CalculatedHash:', calculatedhash);
console.log('Metadata:', metadata);
